import{_ as e,o as a,c as t,Q as i}from"./chunks/framework.385ac4c3.js";const b=JSON.parse('{"title":"Montaje Electromecánico","description":"","frontmatter":{},"headers":[],"relativePath":"disciplinas/montaje_electromecanico.md","filePath":"disciplinas/montaje_electromecanico.md"}'),o={name:"disciplinas/montaje_electromecanico.md"},r=i('<h1 id="montaje-electromecanico" tabindex="-1">Montaje Electromecánico <a class="header-anchor" href="#montaje-electromecanico" aria-label="Permalink to &quot;Montaje Electromecánico&quot;">​</a></h1><h2 id="estandares-de-subestaciones-de-alta-tension-tipo-intemperie" tabindex="-1">Estandares de subestaciones de alta tensión tipo intemperie <a class="header-anchor" href="#estandares-de-subestaciones-de-alta-tension-tipo-intemperie" aria-label="Permalink to &quot;Estandares de subestaciones de alta tensión tipo intemperie&quot;">​</a></h2><p>Los trabajos comprenden toda la mano de obra necesaria para realizar las tareas indicadas a continuación, incluyendo el personal y herramientas.</p><p>Tareas a incluir:</p><blockquote><ul><li>Todo el montaje electromecánico</li><li>Precomisionado</li><li>Zanjeo</li><li>Tapada de malla de PAT desde cero.</li></ul></blockquote><p>Se trabaja con configuraciones típicas simples por lo que se deben verificar particularidades técnicas como por ejemplo: layouts especiales por futuras ampliaciones, reactores y bancos de capacitores de compensación, conexión maniobrable de trafos de reserva, etc.</p><p>No incluye:</p><blockquote><ul><li>Distribución de media tensión más allá de lo necesario para sus propios servicios auxiliares (por ejemplo celda de acometida desde parques eólicos o distribución de ramales).</li><li>Instalaciones asociadas a obras edilicias (iluminación, tomas, incendio, etc).</li><li>Trabajos de comisionado de equipos y sistemas.</li></ul></blockquote><p>Valores referenciales por vano con interruptor según tipo unifilar (todo prorrateado)</p><table><thead><tr><th>DESCRIPCIÓN</th><th>NIVEL DE TENSION EN KV: 500</th><th>NIVEL DE TENSION EN KV: 220</th><th>NIVEL DE TENSION EN KV: 132</th><th>NIVEL DE TENSION EN KV: 66</th><th>NIVEL DE TENSION EN KV: 33</th></tr></thead><tbody><tr><td>SIMPLE BARRA</td><td>7.000</td><td>5.500</td><td>4.000</td><td>ND</td><td>ND</td></tr><tr><td>DOBLE BARRA</td><td>NA</td><td>7.500</td><td>5.000</td><td>ND</td><td>ND</td></tr><tr><td>SIMPLE BARRA y BARRA DE TRANSFERENCIA</td><td>NA</td><td>6.500</td><td>4.500</td><td>ND</td><td>ND</td></tr><tr><td>DOBLE BARRA CON BARRA DE TRANSFERENCIA</td><td>NA</td><td>9.000</td><td>5.500</td><td>ND</td><td>ND</td></tr><tr><td>DOBLE BARRA EN U</td><td>NA</td><td>ND</td><td>6.000</td><td>ND</td><td>ND</td></tr><tr><td>INTERRUPTOR Y MEDIO (VANO COMPLETO)</td><td>10.000</td><td>NA</td><td>NA</td><td>ND</td><td>ND</td></tr><tr><td>INTERRUPTOR Y MEDIO (VANO INCOMPLETO)</td><td>8.000</td><td>NA</td><td>NA</td><td>ND</td><td>ND</td></tr></tbody></table><h2 id="estandares-de-equipos-y-materiales-especificos-de-subestaciones" tabindex="-1">Estandares de equipos y materiales específicos de subestaciones <a class="header-anchor" href="#estandares-de-equipos-y-materiales-especificos-de-subestaciones" aria-label="Permalink to &quot;Estandares de equipos y materiales específicos de subestaciones&quot;">​</a></h2><h3 id="equipos-de-playa-intemperie" tabindex="-1">Equipos de playa intemperie <a class="header-anchor" href="#equipos-de-playa-intemperie" aria-label="Permalink to &quot;Equipos de playa intemperie&quot;">​</a></h3><p>Los trabajos comprenden toda la mano de obra necesaria para realizar las tareas indicadas a continuación, incluyendo el personal y herramientas.</p><p>Tareas a incluir:</p><blockquote><ul><li>Montaje del equipo</li><li>Precomisionado mecánico del equipo, incluyendo todos los componentes que son parte estándar de la provisión del propio fabricante.</li><li>Desembalaje</li><li>Control de packing list</li><li>Nivelación y regulación prelimianar, con asistencia de supervisor del fabricante si es necesario.</li></ul></blockquote><p>No incluye:</p><blockquote><ul><li>Canalizaciones externas, conectores, conexionados de baja tensión, estructuras soporte (salvo interruptores) etc.</li></ul></blockquote><p>Valores de referencia:</p><p>Valores de referencia para un nivel de tensión de 500 KV</p><table><thead><tr><th>DESCRIPCIÓN</th><th>UNIDAD</th><th>PESO UNIT KG</th><th>HH/UNIDAD</th><th>KG/HH</th></tr></thead><tbody><tr><td>INTERRUPTOR TRIPOLAR</td><td>u</td><td>12.500</td><td>370</td><td>33,78</td></tr><tr><td>SECCIONADOR TRIPOLAR con PAT (PP ó FI)</td><td>u</td><td>3.500</td><td>340</td><td>10,29</td></tr><tr><td>SECCIONADOR TRIPOLAR sin PAT (PP ó FI)</td><td>u</td><td>2.800</td><td>330</td><td>8,48</td></tr><tr><td>DESCARGADOR SOBRETENSION</td><td>u</td><td>650</td><td>20</td><td>32,50</td></tr><tr><td>TRANSFORMADOR DE MEDICION</td><td>u</td><td>2.700</td><td>50</td><td>54,00</td></tr><tr><td>AISLADOR SOPORTE</td><td>u</td><td>400</td><td>12</td><td>33,33</td></tr></tbody></table><h3 id="morseria-de-interconexion-de-equipos-y-barras" tabindex="-1">Morseria de interconexión de equipos y barras <a class="header-anchor" href="#morseria-de-interconexion-de-equipos-y-barras" aria-label="Permalink to &quot;Morseria de interconexión de equipos y barras&quot;">​</a></h3><p>Los trabajos comprenden toda la mano de obra necesaria para realizar las tareas indicadas a continuación, incluyendo el personal y herramientas.</p><p>Tareas a incluir:</p><blockquote><ul><li>Montaje del equipo</li><li>Precomisionado mecánico de cada elemento para su colocacion inicial.</li><li>Desembalaje</li><li>Control de packing list</li><li>Torqueado y regulación.</li></ul></blockquote><p>No incluye:</p><blockquote><ul><li>Posteriores desmontajes y recolocaciones para propósitos de precomisionado.</li></ul></blockquote><p>Valores de referencia:</p><p>AGREGAR Tabla 2 “MORSETERIA DE INTERCONEXION DE EQUIPOS Y BARRAS”</p><h3 id="estructuras-soporte-de-equipos-y-barras" tabindex="-1">Estructuras soporte de equipos y barras <a class="header-anchor" href="#estructuras-soporte-de-equipos-y-barras" aria-label="Permalink to &quot;Estructuras soporte de equipos y barras&quot;">​</a></h3><p>Los trabajos comprenden toda la mano de obra necesaria para realizar las tareas indicadas a continuación, incluyendo el personal y herramientas.</p><p>Valores de referencia:</p><p>AGREGAR Tabla 3 “ESTRUCTURAS SOPORTE DE EQUIPOS Y BARRAS”</p><h3 id="interconexiones-aereas-flexibles-y-rigidas" tabindex="-1">Interconexiones aéreas flexibles y rígidas <a class="header-anchor" href="#interconexiones-aereas-flexibles-y-rigidas" aria-label="Permalink to &quot;Interconexiones aéreas flexibles y rígidas&quot;">​</a></h3><p>Los trabajos comprenden toda la mano de obra necesaria para realizar las tareas indicadas a continuación, incluyendo el personal y herramientas.</p><p>Valores de referencia:</p><p>AGREGAR Tabla 4 “INTERCONEXIONES AEREAS FLEXIBLE Y RÍGIDAS”</p><h3 id="malla-de-puesta-a-tierra" tabindex="-1">Malla de puesta a tierra <a class="header-anchor" href="#malla-de-puesta-a-tierra" aria-label="Permalink to &quot;Malla de puesta a tierra&quot;">​</a></h3><p>Los trabajos comprenden toda la mano de obra necesaria para realizar las tareas indicadas a continuación, incluyendo el personal y herramientas.</p><p>Valores de referencia:</p><p>AGREGAR Tabla 5 “MALLA DE PUESTA A TIERRA”</p>',40),d=[r];function s(n,l,c,p,u,m){return a(),t("div",null,d)}const N=e(o,[["render",s]]);export{b as __pageData,N as default};
